import React from 'react'
import {
    MDBCard,
    MDBCardBody,
    MDBInput,
    MDBValidation,
    MDBValidationItem
} from 'mdb-react-ui-kit';

type Props = {}

export const Signin = ({ }: Props) => {

    const onSubmit = (event: React.FormEvent) => {
        event.preventDefault();
        console.log("TODO: handle submit");
    }

    return (
        <div style={{ alignContent: "center", margin: "auto", maxWidth: 450, marginTop: 120 }} >
            <MDBCard alignment='center' >
                <MDBCardBody>
                    <MDBValidation onSubmit={onSubmit} noValidate className='row g-3'>
                        <MDBValidationItem feedback="Please provide your email" className="col-md-12" >
                            <MDBInput
                                label="Email"
                                type="email"
                                name="email"
                                onChange={() => console.log("typed email")}
                                required
                            />
                        </MDBValidationItem>
                        <MDBValidationItem feedback="Please provide your password" className="col-md-12" >
                            <MDBInput
                                label="Email"
                                type="password"
                                name="email"
                                onChange={() => console.log("typed password")}
                                required
                            />
                        </MDBValidationItem>
                    </MDBValidation>
                </MDBCardBody>
            </MDBCard>
        </div>
    );
}
